import React, {Component} from 'react';
import './payment.css';
import Reveal from 'react-reveal/Reveal';

class Pay extends Component {

    render() {
        return(
            <section className="payment-container">
                <Reveal top delay={500}>
                <h1>PAYMENTS</h1>

                <p>
                    We at Wheaton's martial arts accept payments primarily through email links with
                    Quick Books. A link will be provided below on more information for payments online.
                </p>

                <a href='/' className="qb-logo"></a>

                <p>Otherwise, we accept paypal and cash as a form of month to month payment.</p>
                <div className='line'></div>
                <div className="logo-holder">
                    <a className='ppl-logo'></a>
                    <a className='visa-logo'></a>
                    <a className='cash-logo'></a>
                </div>
                </Reveal>
            </section>
        );
    }
}

export default Pay;
